Here is the JSON array of actions to compute amounts like space available, shipping, storage or demurrage charges:
<OUTPUT_JSON>
[
  {
    "action": "type",
    "selector": "input[name*='space' i], input[placeholder*='space' i]",
    "text": "{space_available}"
  },
  {
    "action": "type", 
    "selector": "input[name*='charge' i]",
    "text": "{charge_amount}"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"calculate\" i), button:has-text(\"compute\" i)"
  },
  {
    "action": "wait",
    "selector": "",
    "text": "2000"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"save\" i)"
  }
]
</OUTPUT_JSON>
